import { useState, useEffect } from "react"
import { useParams } from "react-router-dom"

export const MyRequest = () => {

    const {clientId} = useParams()
    const [genre, setGenres] = useState([])
    const [client, setClients] = useState({})


   useEffect( 
    () => { 
        fetch(`http://localhost:8088/requests?_expand=genre`)
            .then(response=>response.json())
            .then((genreInfo) => { 
                setGenres(genreInfo)
            })
    }, []
   )


    useEffect(
        () => {
            fetch(`http://localhost:8088/clients?&_expand=user&_embed=requests`)
                .then(response => response.json())
                .then((clientInfo) => {
                    const singleClient = clientInfo[0]
                    setClients(singleClient)
                })
        },
        [clientId]
    )

console.log(clientId)

    return (
        <div className="requestInfo">
            <h2>My Request</h2>
            <div>Name: {client.bandName}</div>
            <div>Phone Number: {client.phoneNumber}</div>
            <div>Style of Music: </div> 
            <div>Start Date: </div>
            <div>End Date: </div>
            <div>Number of Songs: </div>

        </div>

    )
}
